import { BsFillCloudUploadFill, BsCheckLg } from "react-icons/bs";
import {  AiFillFileText  } from "react-icons/ai";
import { useState, useEffect } from "react";
import {Watch} from "react-loader-spinner";
import ItemList from './List_item';


function Home() {
  const [ file, setFile ] = useState(null);
  let [loading, setLoading] = useState(true);
  const [ msg, setMsg ] = useState(null);
  const [itemz, setItem] = useState(null);

  useEffect(() => {
    // Check if there is data in local storage
    const storedData = localStorage.getItem('rules');

    if (storedData) {
      console.log()
      // If data is found, parse and set it in the itemz state
      setItem(JSON.parse(storedData));
    }
  }, []);

  function handleUpload() {
    if(!file){
    setMsg("No file Selected");
    return;
    }
    const fd = new FormData();
    fd.append('file',file);

    setMsg("Uploading...");
    setLoading(!loading)
    fetch("http://localhost:3500/upload",{
      method: "POST",
      body: fd,
    })
    .then(res =>  {
      if(!res.ok){
        throw res.statusText;
      }

      setMsg("Upload successful");
      setLoading(!loading)
      return res.json();

    })
    .then(data => {
      const item= data['data'];
      let my_rules = [];
      let tmp_dic = []
      for (let i in item){
        console.log(i%3)
        if(i%3 == 0){
          tmp_dic.push(item[i])
        }
        else if (i%3 ==1){
          tmp_dic.push(item[i])
        }
        else{
          tmp_dic.push(item[i])
          my_rules.push(tmp_dic)
          tmp_dic = []
        }
      }
       setItem(my_rules);
       localStorage.setItem('rules', my_rules);
       console.log(localStorage.getItem('rules'))
       document.getElementById('first').style.display = "none"
      setLoading(true);


  })
    .catch(err=>{
      setMsg("Upload failed");
      console.error(err);
    });
  }
  return (

    <div className="App">
    <div className='wrapper'>
      <h1>Uploading Files</h1>
      <div onClick={()=>{
          const fileInput = document.querySelector("input");
          fileInput.click();
      }} className='wrapper2'>
          <BsFillCloudUploadFill style={{
            fontSize:"50px",
            color:"black",
            }}></BsFillCloudUploadFill>

          <input hidden={true} onChange={(e)=> {setFile(e.target.files[0])
          document.querySelector("section").style.display = "block";
          if(e.target.files[0].name !== undefined)
            document.querySelector(".name").innerText= e.target.files[0].name;  


          } } type="file"/>
      </div>
      <section hidden={true} >
      <div id='span-list'>
      <ItemList
               itemList={itemz}
           />
      <li className='rows' id="first"  >
          <AiFillFileText style={{
            fontSize:"30px",
          }}></AiFillFileText>
          <div className='content'>
            <div className='detail' style={{overflow_y:"scroll"}}>
              <span className='name' >fikjdejefhjlfcjlchejklle_01</span>
            </div>
          </div>
          <div  hidden={true} id="check">
          <BsCheckLg style={{
            fontSize:"30px",
            color:"green",
          }}></BsCheckLg>
          </div>

        </li>

      </div>

      </section>
      <div style={{
        display:'flex',
        alignContent:'center',
        justifyContent:'center',
      }}>
      <Watch
                height="80"
                width="80"
                radius="48"
                ariaLabel="watch-loading"
                wrapperStyle={{}}
                wrapperClassName=""
                color='black'
                visible={!loading}
              />
      </div>
      <div style={{
        display:'flex',
        alignContent:'center',
        justifyContent:'center',
      }}> <button className="upload" onClick={ handleUpload }>Upload</button></div>


     <div style={{
          display:'flex',
          alignContent:'center',
          justifyContent:'center',
        }}>


   { msg && <span style={{
    marginTop:"15px",
    color:'black',
   }}>{msg}</span> }
   </div>


    </div>

    </div>

  );
}

export default Home;
